import React, { useState } from "react";
import { Link } from 'react-router-dom';
import "./signup.css";
import "../theme.css";
import { Input } from "../../components/SignupComponents/Input";

export const SignUpPage = () => {
  const [username, setUsername] = useState("");
  const [name, setName] = useState("");
  const [password, setPassword] = useState("");

  const logoOne = require("./wallet.png");

  return (
    <div className="screen">
      <div className="page">
        <div className="center">
        <h1 className='logo'>
                    WalletWise
                </h1>
                    <img src={logoOne} alt="Wallet Icon" height={50} width={70}/>
          <div className="p-10 flex flex-col justify-between rounded-xl login">
            <div className="pic">
              <div className="uploadpic"></div>
              <h1 className="addpic  font-semibold mt-2 mb-5">
                Add a profile picture!
              </h1>
            </div>
            <Input
              type="email"
              placeholder={"first.last@mail.com"}
              header="Email:"
              value={username}
              setter={setUsername}
            />
            <Input
              type="username"
              placeholder={"first and last name"}
              header="First and Last Name:"
              value={name}
              setter={setName}
            />
            <Input
              type="password"
              placeholder={"password1234"}
              header="Password:"
              value={password}
              setter={setPassword}
            />

            <div className="click">
              {username === "jumana" && name && password === "khaled" ? (
                <Link to={`/setbudget`}>
                  <button type="button" className="next">
                    NEXT
                  </button>
                </Link>
              ) : (
                <button type="button" className="next">
                  NEXT
                </button>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
